import Social_inline from "./Social_inline";
import logo from "../assets/Got7_2022_logo.png";
import { Grid } from "@mui/material";
import { padding } from "@mui/system";

function Discography(params) {
  return (
    <>
      <style>
        {`
          html, body {
            background-color: #F3F6F4;
          }
        `}
      </style>
      <div className="app">
        <Social_inline />
        <div
          className="head-logo"
          style={{
            display: "flex",
            height: "60px",
            justifyContent: "center",
            position: "relative",
            marginTop: "-50px",
          }}
        >
          <img src={logo}></img>
        </div>
        <div className="disc-heading">
          <h1
            style={{
              textAlign: "center",
              marginTop: "60px",
              color: "#3C8350",
              fontSize: "38px",
            }}
          >
            DISCOGRAPHY
          </h1>
        </div>
        <div
          className="disc-body"
          style={{
            // backgroundColor: "white",
            // width: "80%",
            // height: "auto",
            // marginTop: "50px",
            // display: "flex",
            // justifyContent: "center",
            // alignItems: "center",
            // margin: "50px auto",
            // flexWrap: "wrap",
            // padding: "20px",
            backgroundColor:"black"
          }}
        >
            <div className="pop-con"
                      style={{
                        backgroundColor: "white",
                        width: "80%",
                        height: "auto",
                        marginTop: "50px",
                        display: "flex",
                        justifyContent: "center",
                        alignItems: "center",
                        margin: "50px auto",
                        flexWrap: "wrap",
                        padding: "20px",
                      }}
            >
          <div className="disc-show-pop" style={disc_pop}>
            <div className="album-container">
              <div className="album-01" style={album_part}>
                <div className="album-cover">
                  <img
                    src="https://blogger.googleusercontent.com/img/a/AVvXsEh9oMSuhEV74m2MwTvFV7z_EJ8fjZQLgAIlSdEjX4meg8U6aVCv7SvDihAjja7PEOFDK4DEG23GtH1V437Q2zISv5X9oYt8PrUdw1B5uAIsuczI4ZgM8j24vPNAW-lPg4G96v9SoN4UkHL0YdBl1joNRVt1EqDuXCEsShTPirVJYOioqUeihUXXhZOG"
                    alt="got7isourname"
                    style={album_cover}
                  ></img>
                </div>
                <div className="name-album">
                  <h4>GOT7 IS OUR NAME</h4>
                </div>
              </div>
            </div>
            <div className="album-container">
              <div className="album-02" style={album_part}>
                <div className="album-cover">
                  <img
                    src="https://inwfile.com/s-l/3azqfp.jpg"
                    alt="got7tuburrence"
                    style={album_cover}
                  ></img>
                </div>
                <div className="name-album">
                  <h4>TURBRLENCE</h4>
                </div>
              </div>
            </div>
            <div className="album-container">
              <div className="album-03" style={album_part}>
                <div className="album-cover">
                  <img
                    src="https://4.bp.blogspot.com/-KZm3AJVUvKM/Ut3hlgp7V9I/AAAAAAAABBY/ewfAHWZRkfA/s1600/got7.jpg"
                    alt="got it?"
                    style={album_cover}
                  ></img>
                </div>
                <div className="name-album">
                  <h4>GOT IT?</h4>
                </div>
              </div>
            </div>
          </div>
        </div>

        <div className="song-suggestion">
          <div className="song_01" style={song_con}>
            <div className="vdo"></div>
            <div className="song-info">
              <div className="title"></div>
            </div>
          </div>
        </div>
        </div>
      </div>
    </>
  );
}
export default Discography;

const album_part = {
  //   margin: "10px",
  padding: "10px",
  textAlign: "center",
  backgroundColor:"white"
};

const album_cover = {
  width: "150px",
  borderRadius: "5px",
  backgroundColor: "black",
};

const disc_pop = {
  width: "100%",
  display: "flex",
  flexWrap: "wrap",
  justifyContent: "space-around",
  // margin:"0px 10px 0px 10px",
};

const song_con = {
    width:"100px",
    height:"100px",
    backgroundColor:"green"
};
